import React from 'react';

function App() {
  const [dados, setDados] = React.useState(null);

  React.useEffect(() => {
    fetch('http://localhost:3000/usuarios')
      .then((response) => response.json())
      .then((json) => setDados(json));
  }, []);

  return <div>Ola</div>;
}

export default App;
